import React from "react";
import "./header.css";
import logo from "../../assets/images/logo-02.jpg";

const nav__links = [
  {
    path: "#",
    display: "Home",
  },
  {
    path: "#",
    display: "Schedule",
  },
  {
    path: "#",
    display: "Classes",
  },
  {
    path: "#",
    display: "Pricing",
  },
];

const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <div className="nav__wrapper">
          {/* logo */}
          <div className="logo">
            <div className="logo__img">
              <img src={logo} alt="" />
            </div>
            <h2>FitnessZone</h2>
          </div>
          {/* nav menu */}
          <div className="navigation">
            <ul className="menu">
              {nav__links.map(item => (
                <li className="nav__item">
                  <a href={item.path}>{item.display}</a>
                </li>
              ))}
            </ul>
          </div>
          {/* nav right */}
          <div className="nav__right">
            <button className="register__btn">Register</button>
            <span className=""></span>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
